import { Component } from '@angular/core'
import { HttpClient } from '@angular/common/http'

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {
  public eventos: any;
  public eventosFiltrados: any;
  larguraImagem: number = 70;
  margemImagem: number = 2;
  exibirImagem: boolean = true;
  private _filtroLista: string = '';

  public get filtroLista(){
    return this._filtroLista
  }

  public set filtroLista(value: string){
    this._filtroLista = value

    this.eventosFiltrados = this.filtroLista ? this.filtrarEventos(this.filtroLista) : this.eventos
  }

  filtrarEventos(filtrarPor: string): any{
    filtrarPor = filtrarPor.toLocaleLowerCase();

    var eventos =  this.eventos.filter(
      (evento: any)=> {
       return evento.tema.toLocaleLowerCase().indexOf(filtrarPor) != - 1 ||
              evento.local.toLocaleLowerCase().indexOf(filtrarPor) != -1
      }
    )

    return eventos
  }

  constructor(private http: HttpClient){

  }

  ngOnInit(){
    this.getEventos()
  }

  public getEventos(): void {
    this.http.get('https://localhost:5001/api/Evento').subscribe({
      next: (res) => {
        this.eventos = res
        this.eventosFiltrados = this.eventos
        console.log(res)
      },
      error: (err) =>  console.log(err)
  })}

  public updateShowImage(input: boolean){
    this.exibirImagem = input
  }
}
<div action="" class="form-inline">
    <div class="form-group mb-2 row">
        <div class="col-4">
            <input 
            type="text" 
            class="form-control" 
            placeholder="buscar"
            [(ngModel)]="filtroLista"
            >
        </div>
        <div class="col-auto">
            <button class="btn btn-outline-success">Buscar</button>
        </div>
    </div>
</div>
<table class="table table-striped">
    <thead class="table-dark">
        <tr>
            <th>#</th>
            <th>
                <input class="form-check-input mx-2" [checked]="exibirImagem" type="checkbox" (change)="updateShowImage(exibirImagem?false:true)">
                Imagem
            </th>
            <th>Tema</th>
            <th>Local</th>
            <th>Data</th>
            <th>Qtd Pessoas</th>
            <th>Lote</th>
            <th>Opções</th>
        </tr>
    </thead>
    <tbody *ngIf="eventos; else elseBlock">
        <tr *ngFor="let evento of eventosFiltrados">
            <td>{{evento.eventoId}}</td>
            <td>
                <img  *ngIf="exibirImagem"
                    src="../../assets/{{evento.imageURL}}" 
                    [style.width.px]="larguraImagem"
                    [style.margin.px]="margemImagem">
            </td>
            <td>{{evento.tema}}</td>
            <td>{{evento.local}}</td>
            <td>{{evento.dataEvento}}</td>
            <td>{{evento.qtdPessoas}}</td>
            <td>{{evento.lote}}</td>
            <td>
                <button class="btn btn-primary mx-2">Editar</button>
                <button class="btn btn-danger mx-2" >Deletar</button>
            </td>
        </tr>
    </tbody>
    <ng-template #elseBlock>
        <h4>Nenhum evento encontrado</h4>
    </ng-template>
</table>
